import React, { useState } from "react";
import "../Styles/Navbar.css";
import { Link } from "react-router-dom";
import MenuIcon from "@material-ui/icons/Menu";
import CloseIcon from "@material-ui/icons/Close";
import styled from "styled-components";

function Navbar() {
  const [navbar, setNavbar] = useState(false);
  const [click, setClick] = useState(false);

  const shrinkNavbar = () => {
    if (window.scrollY > 60) {
      setNavbar(true);
    } else {
      setNavbar(false);
    }
  };

  const menuBarClick = () => {
    setClick(!click);
  };

  console.log(navbar.valueOf());

  window.addEventListener("scroll", shrinkNavbar);

  return (
    <>
      <div className={navbar ? "nav-shrink" : "nav-large"}>
        <div className="navbarContainer">
          <div
            className={
              navbar ? "shrink-title-logo-container" : "title-logo-container"
            }
          >
            <Link to="/random">
              <img src="" alt="logo from db" className="logo" />
            </Link>
            <h5>GES TEXT FROM DB</h5>
          </div>
          <div
            className={navbar ? "menuiconcontainer" : "blankmenuiconcontainer"}
          >
            <div className="navmenu" onClick={menuBarClick}>
              <i className="icon">
                {click ? (
                  <Menu>
                    <MenuIcon />
                  </Menu>
                ) : (
                  <Close>
                    <CloseIcon className="closeicon" />
                  </Close>
                )}
              </i>
            </div>
          </div>

          <div
            className={
              navbar ? "navigation-container" : "blank-navigation-container"
            }
          >
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
            <li className="navitems">
              <Link to="/aboutus" className="nav-links">
                About us
              </Link>
            </li>
          </div>
        </div>
      </div>
      {/* </div> */}
    </>
  );
}

export default Navbar;

const Menu = styled.div`
  font-size: small;
`;

const Close = styled.div`
  font-size: smaller;
`;
